/*
  ┌──────────┐
  │ eclectic │
  └──────────┘
*/
.commandview .dependency-list {
  display: flex;
  flex-direction: row;
  justify-content: space-between;
}
.commandview .dependency-list .active-dependencies {
  background-color: #212326;
  flex: 1;
}
.commandview .dependency-list .dependency-select-list {
  background-color: #212326;
  flex: 1;
}
.commandview .dependency-list .config-icons {
  margin: 0 0 0 5px;
  height: 16px;
}
.commandview .dependency-list .dependency {
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  height: 16px;
}
.commandview .dependency-list .dependency:hover {
  background-color: #42464c;
  color: #ffffff;
}
.commandview .dependency-list .dependency .actions {
  display: flex;
  flex-direction: row;
}
